import { Component, OnInit } from '@angular/core';

@Component({
    selector: 'app-footer',
    templateUrl: './footer.component.html',
    styleUrls: ['./footer.component.scss'],
    standalone: true,
})
export class FooterComponent implements OnInit {

  public year: number = new Date().getFullYear();

  constructor() { }

  ngOnInit(): void { }
}
<div class="flex h-16 items-center bg-background">
  <div class="flex w-full items-center justify-between px-7 text-[13px] font-medium">
    <div class="text-muted-foreground/50">
      <span class="mr-2">{{ year }}©</span>
      <a href="https://walteribanez555.github.io/" target="_blank" class="hover:text-primary">
        Made with ❤️ by Walter Ibañez
      </a>
    </div>
    <ul class="flex text-muted-foreground/50">
      <li class="hover:text-primary">
        <a href="walteribanez555@gmail.com" target="_blank" class="menu-link px-2">
          Issues
        </a>
      </li>

    </ul>
  </div>
</div>
